    prime = [True for i in range(n + 1)]
    p = 2
    while p * p <= n:
        if prime[p] == True:
            for i in range(p * p, n + 1, p):
                prime[i] = False
        p += 1
    prim = []
    for i in range(2, 10 ** 4 + 1):
        if prime[i]:
            prim.append(i)
    for i in prim:
        for j in prim:
            if i + 2 * j > 10000:
