def fill_sieve(N):
    size = N
    sieve = [i for i in range(size + 1)]
    for i in range(2, size + 1):
        if sieve[i] == i:
            j = i * 2
            while j < size + 1:
                sieve[j] = i
                j += i
    return sieve

def soln(nrr):
    maxn = max(nrr) + 1
    sieve = fill_sieve(maxn)
    primes = [i for i in range(len(sieve)) if i == sieve[i] and i >= 2]
    counts = [0] * maxn
    for i in primes:
        cur = 2 * i
        for prime in primes:
            if cur + prime < maxn:
                counts[cur + prime] += 1
    for n in nrr:
        print(counts[n])
