def make_pr(p_limit):
    track = [False, True] * (p_limit // 2 + 1)
    if p_limit % 2 == 0:
        track.pop()
    track[0:3] = [False, False, True]
    pc = 3
    while pc * pc <= p_limit:
        if track[pc]:
            for a in range(pc * pc, p_limit + 1, 2 * pc):
                track[a] = False
        pc += 2
    return [p for (p, isp) in enumerate(track) if isp]
