all_n = list()
for i in primeslist:
    for j in primeslist:
        if i + 2 * j <= limit:
            all_n.append(i + 2 * j)
        else:
            break
all_n_counter = Counter(all_n)

def solve(n):
    if n in all_n_counter:
        return all_n_counter[n]
    else:
        return 0

