    primeBoolList[:3] = [False, False, True]
    lastSeenPrimeNumber = 3
    while lastSeenPrimeNumber * lastSeenPrimeNumber < maxRange:
        if primeBoolList[lastSeenPrimeNumber]:
            for i in range(lastSeenPrimeNumber * lastSeenPrimeNumber, maxRange, lastSeenPrimeNumber * 2):
                primeBoolList[i] = False
        lastSeenPrimeNumber += 2
    return [prime for (prime, isPrime) in enumerate(primeBoolList) if isPrime]

