def makePr(p_limit):
    track = [False, True] * (p_limit // 2 + 1)
    if p_limit % 2 == 0:
        track.pop()
    track[0:3] = [False, False, True]
    pc = 3
    while pc * pc <= p_limit:
        if track[pc]:
            for a in range(pc * pc, p_limit + 1, 2 * pc):
                track[a] = False
        pc += 2
    return [p for (p, isp) in enumerate(track) if isp]

def get_combn(p_limit):
    prs = makePr(p_limit + 1000)
    combn = [0] * (p_limit + 1)
    for (px, p) in enumerate(prs):
        dp = 2 * p
        if dp + 2 > p_limit:
            break
        qx_lim = bisect(prs, p_limit - dp)
        for qx in range(qx_lim):
            combn[prs[qx] + dp] += 1
    return combn
