def checkPrime(num, store):
    up = int(math.ceil(math.sqrt(num)))
    for ele in sorted(store.keys()):
        if ele > up:
            return 1
        if num % ele == 0:
            return 0
    return 1

def solve(n, store, check):
    if n in check:
        sys.stdout.write(str(check[n]) + '\n')
        return
    count = 0
    if n % 2 == 0:
        req = (n - 2) // 2
        ans = 0
        if req in store:
            ans += 1
        sys.stdout.write(str(ans) + '\n')
        return
    for ele in sorted(store.keys()):
        req = n - 2 * ele
        if req < 2:
            break
        if req in store:
            count += 1
    check[n] = count
    sys.stdout.write(str(count) + '\n')
    return
